import Header from './header';
import { Container, Typography } from '@material-ui/core';

export default function Layout(props) {
  return (
    <div>
      <style jsx global>{`
        body {
          margin: 0;
          padding: 0;
          font-size: 18px;
          font-weight: 400;
          line-height: 1.8;
          color: #333;
          font-family: sans-serif;
        }
        h1 {
          font-weight: 700;
        }
        p {
          margin-bottom: 10px;
        }
      `}</style>
      <Header></Header>
      <div>
        <Container>
          <Typography
            component="div"
            style={{ backgroundColor: '#cfe8fc', height: '100vh' }}
          >
            {props.children}
          </Typography>
        </Container>
      </div>
    </div>
  );
}
